--  DDL for Function FN_GET_ATTENDENCE
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "TEAM4_202104F"."FN_GET_ATTENDENCE" (P_EMPNO IN VARCHAR2)
    RETURN VARCHAR2
IS
    V_EMPNO VARCHAR2(100);
BEGIN
    SELECT CASE WHEN TO_NUMBER(TO_CHAR(SYSDATE,'HH24MI')) < BGNTIME THEN 'F001'
                WHEN ENDTIME - TO_NUMBER(TO_CHAR(SYSDATE,'HH24MI')) < 500 THEN 'F002'
                WHEN ENDTIME - TO_NUMBER(TO_CHAR(SYSDATE,'HH24MI')) >= 500 THEN 'F003'
                WHEN BGNTIME IS NOT NULL AND ENDTIME IS NULL THEN 'F004'
                WHEN TO_NUMBER(TO_CHAR(SYSDATE,'HH24MI')) > BGNTIME THEN 'F005'
                ELSE
                    'F003'
            END INTO V_EMPNO
    FROM   DCLZ_COMMUTE A, DCLZ_COMMUTE_LOG B
    WHERE  A.CMTE_CODE = B.CMTE_CODE
    AND    B.EMPNO = 1;
        RETURN V_EMPNO;
    EXCEPTION 
        WHEN OTHERS THEN
            RETURN 'F009';
END;

/
--------------------------------------------------------
--  DDL for Function FN_GET_GOHOME
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "TEAM4_202104F"."FN_GET_GOHOME" (P_EMPNO IN VARCHAR2 , P_DCLZ_NO IN VARCHAR2)
    RETURN VARCHAR2
IS
     pragma autonomous_transaction;
    V_EMPNO VARCHAR2(100);
BEGIN
    SELECT CASE WHEN ATTEND_TIME IS NOT NULL AND LVFFC_TIME IS NULL THEN 'F004'
                WHEN STTUS_CODE = 'F001' AND TO_NUMBER(TO_CHAR(SYSDATE,'HH24MISS')) >= ENDTIME THEN 'F001'
                WHEN STTUS_CODE = 'F001' AND ENDTIME - TO_NUMBER(TO_CHAR(SYSDATE,'HH24MISS')) < 500 THEN 'F002'
                WHEN ATTEND_TIME IS NULL THEN 'F003'
                WHEN STTUS_CODE = 'F005' AND TO_NUMBER(TO_CHAR(SYSDATE,'HH24MISS')) > ENDTIME THEN 'F005' 
                ELSE
                    'F003'
            END INTO V_EMPNO
    FROM   DCLZ_COMMUTE A, DCLZ_COMMUTE_LOG B, dclz_mngt c
    WHERE  A.CMTE_CODE = B.CMTE_CODE
    AND    B.EMPNO = C.EMPNO
    AND    B.EMPNO = P_EMPNO
    AND    C.DCLZ_NO = P_DCLZ_NO;

        RETURN V_EMPNO;

END;

