--------------------------------------------------------
--  DDL for Function FN_GET_GOWORK
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "TEAM4_202104F"."FN_GET_GOWORK" (P_EMPNO IN VARCHAR2)
    RETURN VARCHAR2
IS
    V_EMPNO VARCHAR2(100);
BEGIN
    SELECT CASE WHEN TO_NUMBER(TO_CHAR(SYSDATE,'HH24MISS')) < BGNTIME THEN 'F001'
                WHEN TO_NUMBER(TO_CHAR(SYSDATE,'HH24MISS')) > BGNTIME THEN 'F005'
                WHEN BGNTIME IS NOT NULL AND ENDTIME IS NULL THEN 'F004'
                ELSE
                    'F003'
            END INTO V_EMPNO
    FROM   DCLZ_COMMUTE A, DCLZ_COMMUTE_LOG B
    WHERE  A.CMTE_CODE = B.CMTE_CODE
    AND    B.EMPNO = P_EMPNO;
        RETURN V_EMPNO;
    EXCEPTION 
        WHEN OTHERS THEN
            RETURN 'F009';
END;

